import "./HeroImgStyles.css";

import React from 'react';
import IntroImg from '../assets/intro-bg.jpg';

const HeroImg = () => {
  return (
    <div className="hero">
        <div className="mask">
            <img className="intro-img" src={IntroImg}/>;
        </div>
    </div>
  )
}

export default HeroImg
